import axios from 'axios'
import React,{useEffect, useState} from 'react'
import Skeleton from 'react-loading-skeleton'
import Moment from 'react-moment'
import { Baseurl } from '../baseurl'

const CourseReview = ({code}) => {
    const [review, setReview] = useState([])
    const [isFetching, setFecthing] = useState(false)
    useEffect(() => {
        setFecthing(true)
        axios.get(`${Baseurl}coursereview`, {
            params:{code:code}
        }).then((res) => {
            setFecthing(false)
            if (res.data) {
                setReview(res.data) 
                console.log(res.data) 
            }
        })
    }, [])
    return (
        <>
    <div class="container mb-5">
    <div class="row">
        <div class="col-md">
            <div class="rvcard">
                <div class="rvcard-body">
                    <p class="rvcard-title"><strong>Recent Reviews</strong></p>
                    <small class="rvcard-subtitle">Latest Reviews by students</small>
                </div>
             {isFetching ? <Skeleton count={3}/> :
             <></>}
            </div>
        </div>
    </div>
</div>
        </>
    )
}

export default CourseReview
